<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Week 2 - Ishrat Tuli</title>
    <link href="https://fonts.googleapis.com/css2?family=Playfair+Display:ital,wght@0,400;0,600;0,700;1,400&family=Cormorant+Garamond:ital,wght@0,300;0,400;1,300&display=swap" rel="stylesheet">
    <style>
        :root {
            --degas-peach: #f5dcc8;
            --degas-sage: #b8c5a8;
            --degas-blue: #9db4c8;
            --degas-pink: #e8b4bc;
            --degas-cream: #f9f5f0;
            --degas-gold: #d4af37;
            --degas-dark: #3a3228;
        }

        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: 'Cormorant Garamond', serif;
            background: linear-gradient(135deg, var(--degas-cream) 0%, var(--degas-peach) 50%, var(--degas-blue) 100%);
            background-attachment: fixed;
            color: var(--degas-dark);
            overflow-x: hidden;
        }

        body::before {
            content: '';
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background-image: 
                radial-gradient(circle at 20% 30%, rgba(232, 180, 188, 0.2) 0%, transparent 50%),
                radial-gradient(circle at 80% 70%, rgba(156, 180, 200, 0.2) 0%, transparent 50%);
            pointer-events: none;
            z-index: 0;
        }

        .container {
            max-width: 1200px;
            margin: 0 auto;
            padding: 60px 40px;
            position: relative;
            z-index: 1;
        }

        .back-link {
            display: inline-block;
            margin-bottom: 40px;
            padding: 12px 30px;
            background: var(--degas-gold);
            color: var(--degas-dark);
            text-decoration: none;
            font-family: 'Playfair Display', serif;
            font-size: 1.1rem;
            border-radius: 4px;
            transition: all 0.3s ease;
            box-shadow: 0 4px 15px rgba(212, 175, 55, 0.3);
        }

        .back-link:hover {
            background: #c39d2f;
            transform: translateY(-2px);
            box-shadow: 0 6px 20px rgba(212, 175, 55, 0.4);
        }

        header {
            text-align: center;
            margin-bottom: 60px;
            animation: fadeInDown 1s ease;
        }

        h1 {
            font-family: 'Playfair Display', serif;
            font-size: 3rem;
            font-weight: 700;
            color: var(--degas-dark);
            margin-bottom: 15px;
            letter-spacing: 2px;
        }

        .project-meta {
            font-size: 1.3rem;
            color: var(--degas-dark);
            font-style: italic;
            opacity: 0.85;
            font-weight: 300;
        }

        /* Image Gallery Frame */
        .gallery-frame {
            background: var(--degas-cream);
            border: 16px solid var(--degas-gold);
            box-shadow: 
                inset 0 0 0 2px var(--degas-dark),
                inset 0 0 0 10px var(--degas-cream),
                inset 0 0 0 12px var(--degas-gold),
                0 15px 40px rgba(58, 50, 40, 0.25);
            padding: 40px;
            margin-bottom: 40px;
            position: relative;
            animation: fadeInUp 1s ease;
            animation-fill-mode: both;
        }

        .gallery-frame::before,
        .gallery-frame::after {
            content: '';
            position: absolute;
            width: 40px;
            height: 40px;
            border: 3px solid var(--degas-gold);
        }

        .gallery-frame::before {
            top: -3px;
            left: -3px;
            border-right: none;
            border-bottom: none;
        }

        .gallery-frame::after {
            bottom: -3px;
            right: -3px;
            border-left: none;
            border-top: none;
        }

        .main-image {
            width: 100%;
            max-width: 800px;
            margin: 0 auto;
            display: block;
            border: 8px solid var(--degas-pink);
            box-shadow: 0 10px 30px rgba(58, 50, 40, 0.2);
        }

        .image-placeholder {
            width: 100%;
            max-width: 800px;
            height: 600px;
            margin: 0 auto;
            display: flex;
            align-items: center;
            justify-content: center;
            background: linear-gradient(135deg, var(--degas-sage), var(--degas-blue));
            border: 8px solid var(--degas-pink);
            color: rgba(255, 255, 255, 0.7);
            font-size: 1.5rem;
            font-style: italic;
        }

        /* Description Frame */
        .description-frame {
            background: var(--degas-cream);
            border: 16px solid var(--degas-gold);
            box-shadow: 
                inset 0 0 0 2px var(--degas-dark),
                inset 0 0 0 10px var(--degas-cream),
                inset 0 0 0 12px var(--degas-gold),
                0 15px 40px rgba(58, 50, 40, 0.25);
            padding: 40px;
            position: relative;
            animation: fadeInUp 1s ease;
            animation-delay: 0.2s;
            animation-fill-mode: both;
        }

        .description-frame::before,
        .description-frame::after {
            content: '';
            position: absolute;
            width: 40px;
            height: 40px;
            border: 3px solid var(--degas-gold);
        }

        .description-frame::before {
            top: -3px;
            left: -3px;
            border-right: none;
            border-bottom: none;
        }

        .description-frame::after {
            bottom: -3px;
            right: -3px;
            border-left: none;
            border-top: none;
        }

        .description-content {
            line-height: 1.9;
            font-size: 1.15rem;
        }

        .description-content h2 {
            font-family: 'Playfair Display', serif;
            font-size: 2rem;
            color: var(--degas-dark);
            margin: 30px 0 20px 0;
            font-weight: 600;
        }

        .description-content h2:first-child {
            margin-top: 0;
        }

        .description-content p {
            margin-bottom: 20px;
        }

        .painting-accent {
            position: fixed;
            opacity: 0.15;
            z-index: 0;
            pointer-events: none;
        }

        .painting-accent.ballet-1 {
            top: 10%;
            right: 5%;
            width: 300px;
            height: 400px;
            background: linear-gradient(135deg, var(--degas-pink) 0%, var(--degas-peach) 100%);
            border-radius: 50% 50% 40% 60%;
            transform: rotate(-15deg);
            animation: float 8s ease-in-out infinite;
        }

        @keyframes fadeInDown {
            from {
                opacity: 0;
                transform: translateY(-30px);
            }
            to {
                opacity: 1;
                transform: translateY(0);
            }
        }

        @keyframes fadeInUp {
            from {
                opacity: 0;
                transform: translateY(30px);
            }
            to {
                opacity: 1;
                transform: translateY(0);
            }
        }

        @keyframes float {
            0%, 100% {
                transform: translateY(0) rotate(-15deg);
            }
            50% {
                transform: translateY(-20px) rotate(-15deg);
            }
        }

        @media (max-width: 768px) {
            .container {
                padding: 40px 20px;
            }

            h1 {
                font-size: 2rem;
            }

            .gallery-frame,
            .description-frame {
                padding: 25px;
                border-width: 10px;
            }

            .painting-accent {
                display: none;
            }
        }
    </style>
</head>
